rs sharp turns with ease. Safety features include full size disc brakes front + rear, a parking brake and aftermarket xenon headlamps. She’s got a 250cc engine, equivalent to 20.5 horsepower and will do 130km on the highway no problem. Acceleration is top notch, thanks to the Techlusion TFI programmer chip I wired in. When I give her some gas she’ll get up and dance! Much like me after the Golden Knights win a game, she’s nice and loud too thanks to the custom-fabricated pipe, manifold and air intake I had installed on her, while also increasing airflow, and delivering more horsepower. I am also very impressed with the fuel economy, 60mpg is awesome. I could not be happier to have found this diamond in the rough and super stoked for many years of pleasure riding her into the sunset! (Or on a roadtrip to Las Vegas!) #yamaha
